Blockly.Msg.TOUR1_DESCRIPTION01 = "Bem-vindo,<br>clica em »seguinte« e inicia uma visita virtual ao Open Roberta Lab.<br> Vou mostrar como programar um robô com NEPO.<br>Podes terminar esta visita a qualquer momento clicando em »X« no canto superior direito.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "O menu ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Aqui encontras tudo o que precisas para programar o robô!<br><span class='typcn typcn-document-text'></span> Guardar e carregar programas<br><span class='typcn typcn-Roberta'></span> Conectar o teu robô ao Open Roberta Lab<br><span class='typcn typcn-lightbulb'></span> Ajuda para todos os problemas<br><span class='typcn typcn-user'></span>Tudo sobre contas de utilizador, ex. iniciar e terminar sessão";
